import d from "./aaaaaa.json";
let data = d;
export function ido() {
  const q = [];

  data.forEach((e) => {
    let demo = e.changes;
    let a = [];
    for (let index = 0; index < demo.length; index++) {
      a.push(demo[index].changeName);
    }
    e.changes = a;
    q.push(a);
  });

  console.log(q);
}
